m\",slug:\"mannheim\"},{cityId:18220678,name:\"Bonn\",slug:\"bonn\"},{cityId:18220778,name:\"Münster\",slug:\"muenster\"},{cityId:lm,name:gf,slug:ll},{cityId:18223403,name:\"Mainz\",slug:\"mainz\"},{cityId:18220677,name:\"Aachen\",slug:\"aachen\"},{cityId:18224778,name:\"Heidelberg\",slug:\"heidelberg\"},{cityId:18218132,name:\"Kiel\",slug:\"kiel\"},{cityId:kN,name:f_,slug:kM}],lat:52.517,lon:13.3889},relationships:{continent:{links:{self:\"https:\\u002F\\u002Fapi2.wetter.de\\u002Fapi\\u002Fv1\\u002Fcountries\\u002F49\\u002Frelationships\\u002Fcontinent\",related:\"https:\\u002F\\u002Fapi2.wetter.de\\u002Fapi\\u002Fv1\\u002Fcountries\\u002F49\\u002Fcontinent\"}}}}]},\"1\":{fetchTs:1662200417049,timeout:gg,flash:d,fetchedWeather:{data:{type:\"current-conditions\",id:h,attributes:{temperature:bT,weatherSymbol:k,weatherCode:a,windPower:1.784,sunElevation:41.1,tApparent:cD}}}},\"ArticleTeaserList:0\":{cacheBuster:af,cachedArticles:j,showSpinner:d,articles:[{type:q,id:\"4435004\",attributes:{headline:\"Regen, Gewitter, Sturmböen und Hagel \",kicker:\"Wetter am Wochenende\",published:\"2022-09-03T09:37:43+00:00\",slug:\"wetterbericht-fuer-den-03-09-2022-gewitter-und-unwetter-im-westen-und-sueden-erwartet\",canonical:lp,url:lp,summary:lq,image16x9:{entity:r,id:1671856,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1671856\\u002F300x0\\u002Fwetterbericht-fuer-den-03-09-2022-gewitter-und-unwetter-im-westen-und-sueden-erwartet.jpg\",ratio:s,width:db,height:dc,type:R,alt:lq,caption:b,credits:\"© imago images\\u002Fvmd-images, Simon Adomat via www.imago-images.de, www.imago-images.de\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EIm Laufe des Tages bilden sich heute im Süden und Westen immer öfter Regenschauer oder Gewitter und breiten sich allmählich auch bis in die Mitte des Landes aus. Stellenweise sind dabei starker Regen, kleiner Hagel und stürmische Böen mit dabei. Der Norden und Osten bleibt dagegen zeitweise sonnig und trocken. Die Temperaturen liegen meist zwischen 20 und 24 Grad, nur vom Emsland bis zum Rheinland gibt es wärmere 24 bis 28 Grad. An der Küste weht kräftiger, in Böen starker Ostwind.\\u003Cbr\\u003E\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fdeutschland\\u002Faktuelle-wetter-karte-deutschland-c49.html#m=4.5\\u002F51.19\\u002F10.53\\\"\\u003E\\u003Cstrong\\u003EDie aktuellen Temperaturen: so warm wird es in Ihrem Ort\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\\u003Cp\\u003EWetter-News: \\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fflut-in-pakistan-satellitenbilder-zeigen-ausmass-der-ueberflutungen-1200-todesopfer-4999796.html\\\"\\u003E\\u003Cstrong\\u003EÜberschwemmungen in Pakistan – Satellitenbilder zeigen Ausmaß der Zerstörung\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Cbr\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:lr,id:ls,type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:j},{type:q,id:\"4481616\",attributes:{headline:\"Kalte bis frostige Nacht - bis minus 15 Grad\",kicker:\"Norden bleibt - wie so oft - frostfrei\",published:\"2020-02-05T20:15:40+00:00\",slug:\"kalte-bis-frostige-nacht-bis-minus-15-grad\",canonical:lt,url:lt,summary:lu,image16x9:{entity:r,id:1304242,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1304242\\u002F300x0\\u002Fkalte-bis-frostige-nacht-bis-minus-15-grad.jpg\",ratio:s,width:lv,height:lw,type:R,alt:lu,caption:b,credits:\"© dpa, Karl-Josef Hildenbrand, kjh wst\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Zweiteilung in der Nacht und am Tage\",text:\"\\u003Cp\\u003ENach den letzten Flocken klart es im Süden an den Alpen jetzt auf mit frostigen&nbsp;Temperaturen bis minus 15 Grad.&nbsp;Der Norden ist dagegen wolkig und frostfrei. Auch In der Mitte ziehen kompaktere Wolken durch, teilweise ist es&nbsp;auch neblig. Hier und da fallen vereinzelt ein paar Tropfen Regen.&nbsp;Auf&nbsp;Sonne kann sich am Donnerstag besonders die&nbsp;Südhälfte freuen, der Rest kämpft&nbsp;mit mehr oder weniger dickem Hochnebel. Es bleibt also&nbsp;bei der Zweiteilung grau mit etwas Sprühregen in der Nordhälfte, viel Sonne im Süden und Südwesten bei Werten bis zu 9 Grad an der See und 2 bis 4 Grad auf den Bergen.&nbsp;\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5e3af3652399682af54ad202\",id:\"5e3af3652399682af54ad202\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4406945\",attributes:{headline:\"Heißkalter Herbst: Nach dem Frost wird es dank Hoch „Hanneke“ noch einmal warm\",kicker:\"Tschüß Sommer, ein letztes Mal über 25 Grad\",published:\"2019-09-19T09:45:21+00:00\",slug:\"heisskalter-herbst-nach-dem-frost-wird-es-dank-hoch-hanneke-noch-einmal-warm\",canonical:lx,url:lx,summary:ly,image16x9:{entity:r,id:1255005,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1255005\\u002F300x0\\u002Fheisskalter-herbst-nach-dem-frost-wird-es-dank-hoch-hanneke-noch-einmal-warm.jpg\",ratio:s,width:2989,height:1681,type:bR,alt:ly,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Nach Kaltstart viel Sonnenschein\",text:\"\\u003Cp\\u003EBevor Hoch \\\"Hanneke\\\" mit Südwind für warme Tage sorgt, müssen wir nur noch zweimal richtig frieren. Heute ziehen über den Norden und die Mitte noch etliche Wolkenbatzen hinweg, vor allem in einem Streifen von der Nordsee bis zum Erzgebirge und nach Oberfranken hin können die Wolken zeitweise in der Überhand sein. Ganz verzichten muss man aber auf die Sonne nicht. In den Mittelgebirgen und in der Nähe zur Oder kann es auch mal ein paar wenige Tropfen geben, aber die bilden die Ausnahme und die meisten von uns kommen heute trocken durch den Tag.\\u003Cbr\\u003E\\u003Cbr\\u003E​Mit 10 bis 14 Grad im Bergland und bis 16 Grad im Norden und Osten ist es relativ kühl. Im Westen und im Süden da strahlt die Sonne vom Himmel bei nur hier und da mal ein paar harmlosen Wolken, zwischen Mosel, Saar und Neckar sowie am Oberrhein kann es sogar auf weite Strecken absolut wolkenlos sein und das bei 17 bis 20 Grad, wobei die 20 am ehersten zwischen Freiburg und Basel erreicht werden können.&nbsp;\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Cstrong\\u003EWas Sie sonst noch in dieser Woche erwartet und warum alles ein Happy-End nimmt, sehen Sie im Video!\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5d8314a91d90da29970cb7d2\",id:\"5d8314a91d90da29970cb7d2\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4405026\",attributes:{headline:\"Der erste Herbststurm ist da\",kicker:\"Amtliche Warnung vor Sturmböen\",published:\"2019-09-17T07:14:11+00:00\",slug:\"der-erste-herbststurm-ist-da\",canonical:lz,url:lz,summary:lA,image16x9:{entity:r,id:1175217,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1175217\\u002F300x0\\u002Fder-erste-herbststurm-ist-da.jpg\",ratio:s,width:2208,height:1242,type:R,alt:lA,caption:b,credits:\"© dpa, Carsten Rehder, reh cul\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EIm Norden weht ein ruppiger kräftiger Wind, an der Küste ist mit starkem&nbsp;Nordwestwind und mit Sturmböen zu rechnen.&nbsp;Auf Sylt und Rügen erwarten wir&nbsp;auch schwere Sturmböen mit bis zu 100 km\\u002Fh.&nbsp;Bei einem Mix aus Sonne und Wolken ziehen vor allem in der Nordosthälfte sowie in Bayern immer wieder Regenschauer durch, im Westen und Südwesten bleibt es meist trocken. Die Höchstwerte schaffen nur noch 13 bis 18 Grad, lediglich im Südwesten ist es bei 19 bis 23 Grad vereinzelt warm.&nbsp;\\u003Cstrong\\u003EWas Sie sonst noch in dieser Woche erwartet und warum alles ein Happy-End hat, sehen Sie im Video!\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5d80732a1d90da7a245c8332\",id:\"5d80732a1d90da7a245c8332\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4114002\",attributes:{headline:\"Der heißeste Tag des Jahres: Wetterbericht für Deutschland für den 17.05.2017\",kicker:b,published:\"2017-05-17T16:37:03+00:00\",slug:\"der-heisseste-tag-des-jahres-wetterbericht-fuer-deutschland-fuer-den-17-05-2017\",canonical:lB,url:lB,summary:lC,image16x9:{entity:r,id:904317,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F904317\\u002F300x0\\u002Fder-heisseste-tag-des-jahres-wetterbericht-fuer-deutschland-fuer-den-17-05-2017.jpg\",ratio:s,width:1600,height:900,type:R,alt:lC,caption:b,credits:\"© dpa, Roland Weihrauch\"},hasVideo:d,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EHeute halten sich nach Norden hin zunächst viele Wolken, hier und da sind noch schwache Schauer möglich. Später ist es oftmals trocken und zunehmend sonniger. Im Osten gibt es neben einigen, meist lockeren oder hohen Wolkenfeldern viel Sonnenschein und es bleibt&nbsp;weitgehend trocken. Im Westen und Süden wird es&nbsp;überwiegend sonnig und niederschlagsfrei, im nördlichen NRW und östlichen Bayern halten sich teils noch kompaktere Wolkenfelder. Dabei erreichen wir sommerliche Temperaturen, die Höchstwerte liegen zwischen 22 bis 30 Grad, an der See bei auflandigem Wind teils nur 17 bis 20 Grad. Der Wind weht schwach bis mäßig, tagsüber teils böig aus Ost bis Süd.\\u003Cbr\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:b},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"2906675\",attributes:{headline:\"Unwetterkarte Deutschland\",kicker:b,published:\"2016-05-24T06:41:22+00:00\",slug:\"unwetterkarte-deutschland\",canonical:lD,url:lD,summary:\"Heute kann es vor allem im Osten noch einmal zu Starkregen mit Hagel kommen. Extreme Temperaturunterschiede lassen es an der Grenze zwischen warm und kalt ebenfalls kräftig regnen.\",image16x9:b,hasVideo:d,hasGallery:d,intro:[],content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d}],page:c,lastPageReached:d},\"ArticleTeaserList:1\":{cacheBuster:af,cachedArticles:j,showSpinner:d,articles:[{type:q,id:\"4452543\",attributes:{headline:\"7-Tage-Wettertrend: Hitze, Schwüle und Gewitter \",kicker:\"Danach kämpft sich Herbst zurück\",published:\"2022-09-03T09:39:17+00:00\",slug:\"7-tage-wettertrend-hitze-wird-ende-naechster-woche-durch-gewitter-und-temperatursturz-abgeloest\",canonical:lE,url:lE,summary:lF,image16x9:{entity:r,id:1486923,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1486923\\u002F300x0\\u002F7-tage-wettertrend-hitze-wird-ende-naechster-woche-durch-gewitter-und-temperatursturz-abgeloest.jpg\",ratio:s,width:2445,height:1375,type:R,alt:lF,caption:b,credits:\"© dpa, Armin Weigel, awe fgj\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EEin nie endender Sommer – blüht uns das in diesem verrückten Hitze-Jahr 2022? Wohl eher nicht, denn auch der heißeste Sommer hat irgendwann ein Ende, und das vielleicht schon Ende nächster Woche. Auch wenn die zweite Septemberwoche nochmal mit schwül-heißen Temperaturen, Gewittern und im späteren Verlauf auch Unwettern an den Start geht, wird es spätestens ab Freitag deutlich wechselhafter und kühler, Hitzemarken werden dann garantiert nicht mehr überschritten.\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002F42-tage-wettertrend-erst-hitze-im-spaetsommer-dann-stuerzt-der-herbst-im-september-ab-mit-mehr-regen-4548149.html\\\"\\u003E\\u003Cstrong\\u003EUnd wie geht es weiter? Unser 42-Tage-Trend verrät es\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F63130d0903dd1a0417084f02\",id:\"63130d0903dd1a0417084f02\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d},{type:q,id:\"4527515\",attributes:{headline:\"14-Tage-Wetter im Video: Kaum Regen in Sicht\",kicker:\"September bleibt ein Hochdruck-Monat\",published:\"2020-09-13T13:38:01+00:00\",slug:\"14-tage-wetter-im-video-im-september-kaum-regen-in-sicht\",canonical:lG,url:lG,summary:lH,image16x9:{entity:r,id:1478631,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1478631\\u002F300x0\\u002F14-tage-wetter-im-video-im-september-kaum-regen-in-sicht.jpg\",ratio:s,width:db,height:dc,type:R,alt:lH,caption:b,credits:\"© imago images\\u002FRupert Oberhäuser, Rupert Oberhäuser via www.imago-images.de, www.imago-images.de\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Erst sonnig und heiß, dann sonnig und kühler\",text:\"\\u003Cp\\u003EDer Sommer 2020 endet am 22.September. Und auch das Wetter steigt – nach den hochsommerlichen Temperaturen zu Wochenbeginn – auf die jahreszeitliche Abkühlung ein. Doch bringt der Wetterwechsel endlich auch mal Regen. Nötig wäre er definitiv.&nbsp;\\u003Cstrong\\u003EMehr dazu sehen Sie im Video.\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5f5e188ca75eb3427c0521f1\",id:\"5f5e188ca75eb3427c0521f1\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4544197\",attributes:{headline:\"Service für das lange Wochenende bei gelockerten Corona-Maßnahmen\",kicker:\"Wassertemperaturen und was noch zu beachten ist\",published:\"2020-05-19T05:57:15+00:00\",slug:\"sommerwetter-langes-wochenende-und-weniger-corona-massnahmen\",canonical:lI,url:lI,summary:lJ,image16x9:{entity:r,id:1200784,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1200784\\u002F300x0\\u002Fsommerwetter-langes-wochenende-und-weniger-corona-massnahmen.jpg\",ratio:s,width:lv,height:lw,type:R,alt:lJ,caption:b,credits:\"© dpa, Roland Weihrauch, rwe cul\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Was geht bei diesem Wetter?\",text:\"\\u003Cp\\u003EDas erste lange Wochenende nach der Lockerung der Corona-Maßnahmen steht vor der Tür.&nbsp;\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fdas-wetter-fuer-den-vatertag-2020-sonne-satt-und-sommer-temperaturen-2305110.html\\\"\\u003E\\u003Cstrong\\u003E\\u003Cu\\u003EAußerdem \\u003C\\u002Fu\\u003E\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003Cstrong\\u003E\\u003Cu\\u003E\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fdas-wetter-fuer-den-vatertag-2020-sonne-satt-und-sommer-temperaturen-2305110.html\\\"\\u003Esteigt die Formkurve beim Wetter in Richtung Christi Himmelfahrt \\u003C\\u002Fa\\u003E\\u003C\\u002Fu\\u003E\\u003C\\u002Fstrong\\u003Ebeziehungsweise&nbsp;Vatertag&nbsp;deutlich an. Wie sehen die Bedingungen&nbsp;für&nbsp;typische Frühlings- bis Sommer-Aktivitäten aus? Wie&nbsp;kalt oder warm sind Deutschlands Seen? Was machen die Temperaturen in Nord- und Ostsee? Muss ich mich jetzt gegen Sonnenbrand eincremen und wie steht es um die&nbsp;Waldbrandgefahr?\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Cstrong\\u003EOben im Video sehen Sie, welches Wetter uns an den freien Tagen erwartet.\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5ec12cb5ab2d7654ec21bd7c\",id:\"5ec12cb5ab2d7654ec21bd7c\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4469963\",attributes:{headline:\"Wochenendwetter: Skandi-Tief Heike schickt uns Polarluft\",kicker:\"Endlich wieder Winter\",published:\"2020-01-19T07:06:51+00:00\",slug:\"wochenendwetter-skandi-tief-heike-schickt-uns-polarluft\",canonical:lK,url:lK,summary:lL,image16x9:{entity:r,id:1326572,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1326572\\u002F300x0\\u002Fwochenendwetter-skandi-tief-heike-schickt-uns-polarluft.jpg\",ratio:s,width:dY,height:dZ,type:bR,alt:lL,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Wir schlittern Richtung Winter\",text:\"\\u003Cp\\u003EDie Wetterwoche hatte definitiv einiges im Programm. Doch Winter war bislang noch nicht dabei. Stattdessen vermeldeten Teile Norddeutschlands neue Rekorde der anderen Art. Erst die mildeste Januarnacht seit Beginn der Wetteraufzeichnungen und anschließend auch neue Rekorde bei den Höchstwerten von bis zu 15 Grad. So warme Luft so weit im Norden. Ein absolutes Novum. Gleichzeitig Pollenflug von Erle und Hasel und zum Teil richtig viel Sonne. &nbsp;\\u003C\\u002Fp\\u003E\\u003Cp\\u003EZum Wochenende ändert sich das Feeling aber grundlegend und wir schlittern vom Vorfrühling zurück in Richtung Winter.\\u003Cstrong\\u003E Schnee, Nachtfrost, Glätte \\u003C\\u002Fstrong\\u003Esowie ein \\u003Cstrong\\u003Eerhöhtes Bibberfeeling\\u003C\\u002Fstrong\\u003E und \\u003Cstrong\\u003Eeinstellige Höchstwerte\\u003C\\u002Fstrong\\u003E. Unser Wochenend-Wetter-Check mit allem, was Sie zum Besuch der Polarluft wissen müssen.&nbsp;\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5e20871044fb5152a0060436\",id:\"5e20871044fb5152a0060436\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4450671\",attributes:{headline:\"Stürmisch mit Schnee auf den Bergen\",kicker:\"Aufgepasst: Erkältungswetter!\",published:\"2019-12-09T10:01:18+00:00\",slug:\"stuermisch-mit-schnee-auf-den-bergen\",canonical:lM,url:lM,summary:lN,image16x9:{entity:r,id:940166,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F940166\\u002F300x0\\u002Fstuermisch-mit-schnee-auf-den-bergen.jpg\",ratio:s,width:2121,height:1193,type:R,alt:lN,caption:b,credits:\"© Getty Images, portishead1\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Eine abwechslungsreiche Woche hat begonnen. Mit allem, was die mitteleuropäische Wetterküche zu bieten hat\",text:\"\\u003Cp\\u003EDie \\u003Cstrong\\u003ETiefdruckgebiete \\u003C\\u002Fstrong\\u003Egeben sich zur Zeit die Klinke in die Hand. Kaum ist das eine abgezogen, rückt vom Atlantik bereits das nächste nach. Momentan haben wir es - passend zur Adventszeit - mit Tief Rudi zu tun. Eigentlich ist Rudi&nbsp;ja das \\\"red-nose\\\" Reindeer, für uns wird es aber eher der \\\"wet-nose\\\" Rudi. Denn es wird nasse&nbsp;Nassen&nbsp;geben. \\u003Cstrong\\u003EDie gesamte Woche über wird es sehr wechselhaft\\u003C\\u002Fstrong\\u003E.&nbsp;\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5dedf8d725ec3a795e4d9805\",id:\"5dedf8d725ec3a795e4d9805\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4447137\",attributes:{headline:\"Stürmischer Start in die neue Woche \",kicker:\"Schwere Sturmböen unterwegs\",published:\"2019-12-08T12:06:55+00:00\",slug:\"stuermischer-start-in-die-neue-woche\",canonical:lO,url:lO,summary:lP,image16x9:{entity:r,id:1301418,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1301418\\u002F300x0\\u002Fstuermischer-start-in-die-neue-woche.jpg\",ratio:s,width:dY,height:dZ,type:R,alt:lP,caption:b,credits:\"© deutsche presse agentur\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Rudi führt nichts Gutes im Schilde \",text:\"\\u003Cp\\u003EDas Sturmtief Rudi hat uns gepackt und einen fiesen 2. Advent beschert. Auf Norddeutschlands höchstem Berg, dem Brocken, wurden&nbsp;Orkanböen von 126 km\\u002Fh gemessen. Helgoland und Sylt bekamen auch orkanartige Winde ab. Aber selbst&nbsp;im Flachland gab es&nbsp;Sturmböen. Und so geht es auch in den Montag. Der Wochenstart wird stürmisch.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5de7cacd0fecb9207c71a40e\",id:\"5de7cacd0fecb9207c71a40e\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d}],page:c,lastPageReached:d},\"ArticleTeaserList:2\":{cacheBuster:af,cachedArticles:j,showSpinner:d,articles:[{type:q,id:\"4510225\",attributes:{headline:\"Aktuelle 3-Tage-Wettervorhersage\",kicker:\"Video-Wetterbericht\",published:\"2022-09-03T07:05:27+00:00\",slug:\"aktuelle-3-tage-wettervorhersage\",canonical:lQ,url:lQ,summary:lR,image16x9:{entity:r,id:1930697,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930697\\u002F300x0\\u002Faktuelle-3-tage-wettervorhersage.jpg\",ratio:s,width:dY,height:dZ,type:bR,alt:lR,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Aktuell und kompetent: Der Video-Wetterbericht für die kommenden Tage\",text:\"\\u003Cp\\u003EIm Video zeigen wir euch die aktuellsten Wettervorhersagen und Prognosen für die kommenden 3 Tage aus dem ntv-Wetter mit unseren Moderatorinnen und Moderatoren Angela Braun, Melanie Bergner, Eva Imhof, Juliana Müller und Paul Heger. Kommen Sie gut durch den Tag und genießen Sie ihn bei jedem Wetter.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:lr,id:ls,type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d},{type:q,id:\"4399671\",attributes:{headline:\"Der Regen- und Wolkenfilm für die nächsten 48 Stunden\",kicker:\"Regen und Gewitter im Süden und Westen\",published:\"2022-09-03T06:58:37+00:00\",slug:\"der-regen-und-wolkenfilm-fuer-die-naechsten-48-stunden\",canonical:lS,url:lS,summary:lT,image16x9:{entity:r,id:1930693,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930693\\u002F300x0\\u002Fder-regen-und-wolkenfilm-fuer-die-naechsten-48-stunden.jpg\",ratio:s,width:dY,height:dZ,type:bR,alt:lT,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Wo regnet es? Wo gibt es Gewitter?\",text:\"\\u003Cp\\u003EDiese Animation zeigt, wie Wolken und Regen heute und morgen über Deutschland ziehen. Schneefälle oder Gewitter werden ggfs. dargestellt. Außerdem sind die Temperaturen für einige größere Städte angegeben.\\u003C\\u002Fp\\u003E\\u003Cp\\u003EDer Wolken- und Regenfilm wird zweimal täglich aktualisiert.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5a079473a2ea50087133a86d\",id:\"5a079473a2ea50087133a86d\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4356180\",attributes:{headline:\"Strömungsfilm der nächsten 5 Tage\",kicker:\"Spanienhitze kommt nach Deutschland\",published:\"2022-09-02T13:36:31+00:00\",slug:\"stroemungsfilm-der-naechsten-5-tage\",canonical:lU,url:lU,summary:lV,image16x9:{entity:r,id:1930582,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930582\\u002F300x0\\u002Fstroemungsfilm-der-naechsten-5-tage.jpg\",ratio:s,width:lW,height:lX,type:bR,alt:lV,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Temperaturentwicklungen für die nächsten Tage\",text:\"\\u003Cp\\u003EBeim Wetter hängt alles mit allem zusammen. Ein Blick auf die Großwetterlage mit ihren großflächigen Luftströmungen hilft beim Verständnis der Prognosen. Aber keine Angst: Man muss kein Experte sein! Die Temperaturentwicklungen für die nächsten Tage sind in unserer Animation gut zu erkennen. Echte Wetterfans können darüber hinaus die Zugbahnen der Hoch- und Tiefdruckgebiete analysieren und Windgeschwindigkeiten abschätzen.\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fwetterbericht-fuer-den-04-03-2020-aprilwetter-mit-sonne-im-sueden-4435004.html\\\"\\u003E\\u003Cstrong\\u003E\\u003Cu\\u003EUnd das ist das Wetter zum Strömungsfilm.\\u003C\\u002Fu\\u003E\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:gh,id:gi,type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4713474\",attributes:{headline:\"Video aus Antarktis: Gigantischer Eisberg abgebrochen\",kicker:\"Halb so groß wie das Saarland\",published:\"2021-03-01T14:29:30+00:00\",slug:\"spektakulaeres-video-aus-antarktis-gigantischer-eisberg-abgebrochen\",canonical:lY,url:lY,summary:lZ,image16x9:{entity:r,id:1591195,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1591195\\u002F300x0\\u002Fspektakulaeres-video-aus-antarktis-gigantischer-eisberg-abgebrochen.jpg\",ratio:s,width:lW,height:lX,type:bR,alt:lZ,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Im Video: Eisberg bricht von Brunt-Schelfeis ab\",text:\"\\u003Cp\\u003EIn der Antarktis ist ein riesiger Eisberg vom Schelfeis abgebrochen. Das teilte die Organisation British Antarctic Survey (BAS) mit. Der Eisberg mit einer Fläche von 1.270 Quadratkilometern – etwa halb so groß wie das Saarland – war Teil des Brunt-Schelfeises. \\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Friss-im-larsen-c-schelfeis-gigantischer-eisberg-wird-sich-bald-loesen-4116262.html\\\"\\u003ESchon seit 2017 hatten britische Forscher, die in der Nähe eine Forschungsstation betreiben, einen Riss beobachtet.\\u003C\\u002Fa\\u003E Der habe sich im Januar nun mit bis zu einen Kilometer pro Tag verlängert, hieß es in der BAS-Mitteilung vom Freitag. Am Wochenende wurden spektakuläre Aufnahmen des Eisberg-Abbruchs veröffentlicht – im Video.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F603cc181a6f03c26bf11a483\",id:\"603cc181a6f03c26bf11a483\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4229559\",attributes:{headline:\"Das Martinsloch in der Schweiz: Zweimal im Jahr bietet sich ein wunderbares Naturspektakel\",kicker:\"Sonne scheint durch den Berg\",published:\"2020-09-29T09:32:34+00:00\",slug:\"das-martinsloch-in-der-schweiz-zweimal-im-jahr-bietet-sich-ein-wunderbares-naturspektakel\",canonical:l_,url:l_,summary:l$,image16x9:{entity:r,id:1488696,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1488696\\u002F300x0\\u002Fdas-martinsloch-in-der-schweiz-zweimal-im-jahr-bietet-sich-ein-wunderbares-naturspektakel.jpg\",ratio:s,width:847,height:477,type:bR,alt:l$,caption:b,credits:b},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Faszinierendes Naturschauspiel\",text:\"\\u003Cp\\u003EDas hier ist etwas ganz Besonderes - denn die Sonne scheint DURCH den Berg. Der hat ein Loch. Das Martinsloch. Und an wenigen Tagen im März und September scheint die Sonne für knapp zwei Minuten durch das Felsloch auf den Elmer Kirchturm in der Schweiz. Das fantastisch schöne Spektakel lockt immer wieder viele Zuschauer an – besonders bei&nbsp;blauen Himmel wie im Jahr 2018. Dieses Jahr würde&nbsp;die Sonne am&nbsp;Dienstag, 29. September 2020 um 9:30 Uhr &amp; Mittwoch, 30. September 2020, 9:32. Uhr durch den Berg scheinen, aber das Wetter spielt wohl nicht mit.&nbsp;\\u003Cbr\\u003E\\u003Cbr\\u003EDer direkte Blick in die Lücke im Gestein ist nicht ratsam. Bei klaren Sichtverhältnissen ist ähnliche Vorsicht geboten wie bei einer&nbsp;Sonnenfinsternis. Wenn man direkt in die Sonne schaut, können Augenschäden bis hin zur Erblindung die Folge sein.\\u003Cbr\\u003E\\u003Cbr\\u003E\\u003Cstrong\\u003ESchauen Sie sich deswegen oben im Video das fantastische Naturspektakel&nbsp;in aller Ruhe aus dem Jahr 2018&nbsp;an\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5bb0be54a2ea503e743072af\",id:\"5bb0be54a2ea503e743072af\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4130067\",attributes:{headline:\"In nur 4 Minuten: So gelingt die perfekte Kürbissuppe\",kicker:\"Herbstliches Blitz-Rezept\",published:\"2020-09-22T09:24:30+00:00\",slug:\"4-minuten-rezept-so-schnell-gelingt-die-perfekte-kuerbissuppe\",canonical:\"https:\\u002F\\u002Fwww.rtl.de\\u002Fcms\\u002F4-minuten-rezept-so-schnell-gelingt-die-perfekte-kuerbissuppe-4130067.html\",url:\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002F4-minuten-rezept-so-schnell-gelingt-die-perfekte-kuerbissuppe-4130067.html?c=bec4\",summary:ma,image16x9:{entity:r,id:938557,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F938557\\u002F300x0\\u002F4-minuten-rezept-so-schnell-gelingt-die-perfekte-kuerbissuppe.jpg\",ratio:s,width:2000,height:1125,type:R,alt:ma,caption:b,credits:\"© Getty Images, sandoclr\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"Hokkaido ist der ideale Suppenkürbis\",text:\"\\u003Cp\\u003EIm September und Oktober ist \\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.rtl.de\\u002Fcms\\u002Fsaisonkalender-september-dieses-obst-und-gemuese-hat-im-september-saison-4599277.html\\\"\\u003EKürbis-Hochsaison\\u003C\\u002Fa\\u003E&nbsp;–&nbsp;und was gibt es da besseres als eine selbstgemachte Suppe? Vor allem, wenn sie in gerade mal vier Minuten zubereitet ist! Besonders gut eignet sich dafür der Hokkaido-Kürbis, denn hier können Sie die Schale einfach dranlassen. Im Video zeigt Koch Heiko Schulz, wie einfach und schnell es geht –&nbsp;und verrät, wie Sie&nbsp;das maximale Aroma aus dem Gemüse herausholen!\\u003Cbr\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5f64bfe4da5b540161420247\",id:\"5f64bfe4da5b540161420247\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d}],page:c,lastPageReached:d},\"ArticleTeaserList:3\":{cacheBuster:af,cachedArticles:j,showSpinner:d,articles:[{type:q,id:\"5005016\",attributes:{headline:\"Heftiger Taifun bedroht Teile Japans und Südkoreas\",kicker:\"HINNAMNOR  ist 200 km\\u002Fh schnell \",published:\"2022-09-03T08:04:33+00:00\",slug:\"taifun-rollt-mit-mehr-als-200-km-h-auf-japan-und-suedkorea-zu-hinnamnor-macht-suedostasien-unsicher\",canonical:mb,url:mb,summary:mc,image16x9:{entity:r,id:1930704,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930704\\u002F300x0\\u002Ftaifun-rollt-mit-mehr-als-200-km-h-auf-japan-und-suedkorea-zu-hinnamnor-macht-suedostasien-unsicher.jpg\",ratio:s,width:db,height:dc,type:R,alt:mc,caption:b,credits:\"© REUTERS, ALY SONG, AS\\u002F\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EDer heftige Taifun HINNAMNOR bedroht Teile Japans und seines Nachbarn Südkorea mit starken Sturmböen und Regenfällen. Die japanische Wetterbehörde rief am Samstag die Inselbewohner der südlichsten Präfektur Okinawa zu Vorsicht vor möglichen Erdrutschen durch Regenfälle und Sturmfluten auf. Am selben Tag warnten die Kollegen im benachbarten Südkorea, dass HINNAMNOR am kommenden Dienstag dort nahe der südlichen Stadt Busan auf Land treffen könnte.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:gh,id:gi,type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d},{type:q,id:\"4926938\",attributes:{headline:\"Optische Täuschung: Welches Tier sehen Sie hier?\",kicker:\"Verblüffender 3D-Effekt!\",published:\"2022-09-03T07:37:18+00:00\",slug:\"optische-taeuschung-mit-3d-illusion-einfacher-trick-hilft-das-tier-im-blaetterhaufen-zu-sehen\",canonical:\"https:\\u002F\\u002Fwww.rtl.de\\u002Fcms\\u002Foptische-taeuschung-mit-3d-illusion-einfacher-trick-hilft-das-tier-im-blaetterhaufen-zu-sehen-4926938.html\",url:\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Foptische-taeuschung-mit-3d-illusion-einfacher-trick-hilft-das-tier-im-blaetterhaufen-zu-sehen-4926938.html?c=bec4\",summary:md,image16x9:{entity:r,id:me,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1832782\\u002F300x0\\u002Foptische-taeuschung-mit-3d-illusion-einfacher-trick-hilft-das-tier-im-blaetterhaufen-zu-sehen.jpg\",ratio:s,width:mf,height:mg,type:R,alt:md,caption:b,credits:mh},hasVideo:d,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EAuf den ersten Blick sieht das Bild wie ein wilder Blätterhaufen aus. Der Schein trügt aber. Ein Tier verbirgt sich unter dem Grün. Was erkennen Sie? Der User, der das Bild bei der Plattform Reddit einstellte, schrieb dazu: „Glaubt mir, etwas wird aus eurem Bildschirm herausspringen\\\", wie die britische „Sun“ berichtete.\\u003C\\u002Fp\\u003E\",image:{entity:r,id:me,url:\"https:\\u002F\\u002Fais.rtl.de\\u002Fmasters\\u002F1832782\",ratio:s,width:mf,height:mg,type:R,alt:\"Haben Sie des Rätsels Lösung?\",caption:\"Was für ein Tier erkennen Sie hier?\",credits:mh},media:b},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"4263080\",attributes:{headline:\"Warum Sie jetzt nicht volltanken sollten - und 10 weitere Tipps zum Sprit-Sparen\",kicker:\"Bye bye Tankrabatt! Was Autofahrer wissen müssen\",published:\"2022-09-03T07:34:32+00:00\",slug:\"spritsparen-darum-sollten-sie-jetzt-nicht-volltanken-und-weitere-tipps-zur-besten-uhrzeit-co\",canonical:\"https:\\u002F\\u002Fwww.rtl.de\\u002Fcms\\u002Fspritsparen-darum-sollten-sie-jetzt-nicht-volltanken-und-weitere-tipps-zur-besten-uhrzeit-co-4263080.html\",url:\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fspritsparen-darum-sollten-sie-jetzt-nicht-volltanken-und-weitere-tipps-zur-besten-uhrzeit-co-4263080.html?c=bec4\",summary:mi,image16x9:{entity:r,id:1893287,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1893287\\u002F300x0\\u002Fspritsparen-darum-sollten-sie-jetzt-nicht-volltanken-und-weitere-tipps-zur-besten-uhrzeit-co.jpg\",ratio:s,width:db,height:dc,type:R,alt:mi,caption:b,credits:\"© Daniel Kubirski, R4981 Daniel Kubirski\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:af,text:\"\\u003Cp\\u003EAb dem 1. September ist Schluss mit dem Tankrabatt, an der Zapfsäule wird es für Autofahrer wieder deutlich teurer. Mit unseren Tipps können Sie beim nächsten Stopp an der Tankstelle trotzdem noch einmal sparen, laut ADAC sogar bis zu 20 Prozent! Wir verraten Ihnen, worauf Sie an der Zapfsäule und während der Fahrt achten sollten, um weiter bares Geld zu sparen. \\u003C\\u002Fp\\u003E\\u003Cp\\u003ERTL-Verbraucherexperte Ron Perduss rät außerdem: Jetzt bloß nicht volltanken!\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Cstrong\\u003ELese-Tipp:\\u003C\\u002Fstrong\\u003E \\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.rtl.de\\u002Fcms\\u002Fwegen-tankrabatt-tankstellen-verband-warnt-vor-mega-ansturm-auf-zapfsaeulen-am-1-juni-4967465.html\\\"\\u003EChaos an der Zapfsäule? Tankstellen-Verband warnt: \\\"Der 1. Juni könnte richtig dramatisch werden“\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F6310350ab6528b63610ed4a8\",id:\"6310350ab6528b63610ed4a8\",type:aY}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"5004822\",attributes:{headline:\"Starkregen, Hagel und Überflutungen möglich - der Samstag wird ungemütlich\",kicker:\"Unwettergefahr auch in der kommenden Woche\",published:\"2022-09-02T13:40:21+00:00\",slug:\"unwetter-in-deutschland-wochenende-eroeffnet-schwuele-gewitter-serie-mit-starkregen-hagel-sturmboeen\",canonical:mj,url:mj,summary:mk,image16x9:{entity:r,id:1930340,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930340\\u002F300x0\\u002Funwetter-in-deutschland-wochenende-eroeffnet-schwuele-gewitter-serie-mit-starkregen-hagel-sturmboeen.jpg\",ratio:s,width:db,height:dc,type:R,alt:mk,caption:b,credits:\"© IMAGO\\u002FEinsatz-Report24, IMAGO\\u002FFabian Geier, www.imago-images.de\"},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"von Oliver Scheel\",text:\"\\u003Cp\\u003EEs kommt nun Bewegung in die Wetterküche. Nach einem oft schönen Freitag zieht schon in der Nacht auf Samstag ein dickes Regenband aus Frankreich ins Land. So beginnt es im Westen und Südwesten zu regnen. Aber damit leider nicht genug: Denn der Regen kann sehr ergiebig sein und kommt möglicherweise auch mit Hagel daher. Wegen der trockenen Böden kann es lokal schnell zu vollen Kellern und Überflutungen kommen. Wir sagen Ihnen, wann und wo Sie besonders aufpassen müssen.\\u003Cbr\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F6311ccd16df78215360d2a33\",id:\"6311ccd16df78215360d2a33\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"5004842\",attributes:{headline:\"Ordentlich Energie in der Atmosphäre - gefährliche Lage am Mittelmeer\",kicker:\"Schwere Hagelunwetter drohen\",published:\"2022-09-02T13:32:44+00:00\",slug:\"unwetter-und-hitze-in-europa-schwere-gewitter-starkregen-grosser-hagel-sturm-im-unwetter-herbst\",canonical:ml,url:ml,summary:mm,image16x9:{entity:r,id:1930475,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930475\\u002F300x0\\u002Funwetter-und-hitze-in-europa-schwere-gewitter-starkregen-grosser-hagel-sturm-im-unwetter-herbst.jpg\",ratio:s,width:mn,height:mo,type:R,alt:mm,caption:b,credits:mp},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"von Björn Alexander und Oliver Scheel\",text:\"\\u003Cp\\u003EIm Mittelmeerraum spitzt sich die Wetterlage derzeit zu – es kann extrem brenzlig werden. Warum? Weil das Meer weiterhin sehr warm ist und damit eine ideale Zutat für veritable Unwetter bietet. In den kommenden Tagen wird kaum eine Mittelmeerregion verschont. Es bestehen derzeit Unwettergefahr in den vielen Anrainerstaaten. Mindestens bis Samstag müssen die Urlauber aufpassen.\\u003C\\u002Fp\\u003E\\u003Cp\\u003E\\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Feuropa\\u002Funwetter-karte-frankreich-c33.html#m=4.5\\u002F48.87\\u002F2.33\\\"\\u003E\\u003Cstrong\\u003EAktuelle Unwetterkarte für Frankreich: Hier ist es gerade besonders gefährlich\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F62fe40bdd2ac26a3cd09d5f2\",id:\"62fe40bdd2ac26a3cd09d5f2\",type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:d,preloadImage:d},{type:q,id:\"5004833\",attributes:{headline:\"Sturmsaison Europa bringt spannende Weichenstellung in der Wetterküche\",kicker:\"Tropenstürme als Warmluftschleuder?\",published:\"2022-09-02T13:30:56+00:00\",slug:\"herbst-und-winter-bringen-sich-in-stellung-sturmtiefs-aktiv-mit-auswirkungen-auf-wetter-in-deutschland\",canonical:mq,url:mq,summary:mr,image16x9:{entity:r,id:1930453,url:\"https:\\u002F\\u002Faiswetter-a.akamaihd.net\\u002Fmasters\\u002F1930453\\u002F300x0\\u002Fherbst-und-winter-bringen-sich-in-stellung-sturmtiefs-aktiv-mit-auswirkungen-auf-wetter-in-deutschland.jpg\",ratio:s,width:mn,height:mo,type:R,alt:mr,caption:b,credits:mp},hasVideo:j,hasGallery:d,intro:{entity:w,headline:\"von Letizia Vecchio und Paul Heger \",text:\"\\u003Cp\\u003EDer Sommer neigt sich seinem Ende zu und zumindest \\u003Ca target=\\\"_blank\\\" href=\\\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fmeteorologischer-und-kalendarischer-herbstanfang-was-ist-der-unterschied-4823723.html\\\"\\u003E\\u003Cstrong\\u003Emeteorologischhat der Herbst ja bereits angefangen\\u003C\\u002Fstrong\\u003E\\u003C\\u002Fa\\u003E. Langsam aber sicher wird sich das Wetter nach diesem Hitze-Sommer drehen – die großen Wettersysteme nehmen an Fahrt auf und gehen auf Herbst- und Winterzeit. Allerdings wird unser Deutschland-Wetter nicht nur durch Hoch- und Tiefdruckgebiete innerhalb Europas beeinflusst, sondern auch von Übersee kann das ein oder andere zu uns herüberschwappen – und das könnte in diesem noch jungen Herbst besonders spannend werden.\\u003C\\u002Fp\\u003E\",image:b,media:{entity:y,entityUrl:gh,id:gi,type:aI}},content:[],meta:[],jsonld:[],tracking:[],analytics:[],teaser:[],teaserShort:[],teaserRelated:[],tags:[],related:[],options:[]},isHighlight:j,preloadImage:d}],page:c,lastPageReached:d},\"surrounding-cities:0\":{fetchedData:{data:{type:\"location-radius\",id:h,attributes:[{locationId:18219243,geoHash:h,name:\"Nützen\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-nuetzen-18219243.html\"},{locationId:gj,geoHash:h,name:gk,nameSuffix:b,country:x,url:d$},{locationId:18219222,geoHash:h,name:\"Kaltenkirchen\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-kaltenkirchen-18219222.html\"},{locationId:18219213,geoHash:h,name:\"Heidmoor\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-heidmoor-18219213.html\"},{locationId:18219234,geoHash:h,name:\"Wierenkamp\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-wierenkamp-18219234.html\"},{locationId:18219253,geoHash:h,name:\"Schmalfeld\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-schmalfeld-18219253.html\"},{locationId:18219245,geoHash:h,name:\"Oersdorf\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-oersdorf-18219245.html\"},{locationId:18219223,geoHash:h,name:\"Bollweg\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-bollweg-18219223.html\"},{locationId:18219212,geoHash:h,name:\"Hasenmoor\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-hasenmoor-18219212.html\"},{locationId:18219181,geoHash:h,name:\"Bad Bramstedt\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-bad-bramstedt-18219181.html\"},{locationId:18219179,geoHash:h,name:\"Alveslohe\",nameSuffix:b,country:x,url:\"\\u002Fdeutschland\\u002Fwetter-alveslohe-18219179.html\"},{locationId:18219224,geoHash:h,name:\"Kattendorf\",nameSuffix:b,coun