,-21.9,93.7,53.1,56.4,101.1,63.8,32.7,27,2.8,97.2,101.5,28.5,35.5,103.9,59.4,40.7,46.1,43.2,23.1,26.2,42.8,42.7,25.3,25.9,39.2,107.7,91.7,40.4,78.5,48.5,46.4,37.6,4.7,-8.5,94,52.2,52.1,-22.3,10.2,-28.7,106,57,36.6,32.3,112.9,34.2,111.6,47,106.1,29.1,97.1,38,89.8,41.2,-22.6,\"2022-09-06T18:00:00Z\",-29.1,45.9,95.2,-26.1,97.8,64.3,21.6,11.1,44.6,50.2,48.1,118.6,38.5,33.8,113.6,82.4,114.1,78.6,-16.8,119.1,79,-29.5,-29.4,29.8,116.2,-26.5,74,57.4,115.2,39.7,26.6,52.4,38.1,51.9,2.4,24,108.9,111.5,59.5,-17.1,5.6,28.1,81.7,-27.8,72.8,77.4,-29.8,90.8,90.1,92.6,86.1,25.4,73.2,27.1,37.7,70,31.9,81.6,7.3,83.3,89.3,3.1,-23.8,215.4,-28.2,96.7,223.2,98,1.5,.4,10.3,81,40.8,85,36.2,94.8,88.5,95.8,-30.5,95.6,95.4,26.1,88.2,24.3,235.7,76.2,31.1,83,86.6,37.2,90.4,6.4,96.3,-30.9,264.2,26.5,36,79.9,86.2,9,92.3,20.9,93.3,12.8,88.6,70.8,271,70.2,27.6,5.9,1006,93,86,1007,1005,31.7,1002,171,1000,82,90.6,998,27.3,997,87.1,34.5,77.9,37,38.2,88.4,91.2,92.2,28,224.6,44.7,211.9,.6,28.4,100150,\"Helgoland\",100200,18219464,\"Schwerin\",\"Greifswald\",18220609,\"hannover\",18219670,\"Magdeburg\",104001,\"duesseldorf\",18220611,\"essen\",18220613,\"leipzig\",18232916,104880,\"dresden\",18232486,\"erfurt\",18234542,\"frankfurt\",18221009,\"Frankfurt\",\"Hof\",\"Saarbrücken\",\"karlsruhe\",18224714,\"stuttgart\",18224193,\"nuernberg\",18227303,108520,\"augsburg\",18227851,18225183,47.6661,9.16276,\"Kempten\",109610,18228265,99000036,\"muenchen\",18225562,\"Ilsenburg\",\"Bodensee\",\"freiburg\",18224951,\"Bayern\",\"bayern\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fwetterbericht-fuer-den-03-09-2022-gewitter-und-unwetter-im-westen-und-sueden-erwartet-4435004.html\",\"Im Laufe des Tages bilden sich heute im Süden und Westen immer öfter Regenschauer oder Gewitter und breiten sich allmählich auch bis in die Mitte des Landes aus. Stellenweise sind dabei starker Regen, kleiner Hagel und stürmische Böen möglich.\",\"http:\\u002F\\u002Farc-gip-bff\\u002Fapi\\u002Fvideo\\u002Fvideo\\u002F5fa3e26a879e5a560b695759\",\"5fa3e26a879e5a560b695759\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fkalte-bis-frostige-nacht-bis-minus-15-grad-4481616.html\",\"Während sich der Süden nach einer frostigen Nacht mit bis zu -15 Grad auf einen sonnigen Donnerstag freuen kann, versteckt sich der Norden unter einer Wolkendecke. Allerdings bei milden Temperaturen.\",3000,1688,\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fheisskalter-herbst-nach-dem-frost-wird-es-dank-hoch-hanneke-noch-einmal-warm-4406945.html\",\"Die nächste Nacht wird knackig kalt, die Tage verwöhnen uns dann aber mit viel Sonnenschein. Das Wochenende beschert uns noch einmal schönen Spätsommer mit Höchstwerten bis 27 Grad. Dann sagt er aber Adieu...\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fder-erste-herbststurm-ist-da-4405026.html\",\"Die Nordlichter erwarten Sturmböen bei Windstärke 10, im Südosten werden Sie ordentlich nass bei einigen Regengüssen. Nur in der Mitte und im Südwesten bleibt es trocken und teilweise wird es sogar warm.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fder-heisseste-tag-des-jahres-wetterbericht-fuer-deutschland-fuer-den-17-05-2017-4114002.html\",\"Heute ist oft strahlend schön, nur Richtung Küsten halten sich am Vormittag noch dichtere Wolken mit letzten Tropfen. Sonst erwarten wir aber viel Sonne und Temperaturen von meist 25 bis 30 Grad. Nur an der See bleibt es bei 17 bis 20 Grad.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Funwetterkarte-deutschland-2906675.html\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002F7-tage-wettertrend-hitze-wird-ende-naechster-woche-durch-gewitter-und-temperatursturz-abgeloest-4452543.html\",\"Ein nie endender Sommer – blüht uns das in diesem verrückten Hitze-Jahr 2022? Wohl eher nicht, denn auch der heißeste Sommer hat irgendwann ein Ende, und das vielleicht schon Ende nächster Woche. Auch wenn vorher nochmal richtig heiß wird.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002F14-tage-wetter-im-video-im-september-kaum-regen-in-sicht-4527515.html\",\"Der Sommer 2020 endet am 22.September. Und auch das Wetter steigt – nach den hochsommerlichen Temperaturen zu Wochenbeginn – auf die jahreszeitliche Abkühlung ein. Doch bringt der Wetterwechsel endlich auch mal Regen. Nötig wäre er definitiv.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fsommerwetter-langes-wochenende-und-weniger-corona-massnahmen-4544197.html\",\"Das erste lange Wochenende nach der Lockerung der Corona-Maßnahmen steht vor der Tür. Und das Wetter ist im Aufwärtstrend. \",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fwochenendwetter-skandi-tief-heike-schickt-uns-polarluft-4469963.html\",\"Der 7-Tage-Trend: Winterfeeling mit Schneeschauern\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fstuermisch-mit-schnee-auf-den-bergen-4450671.html\",\"Die Tiefdruckgebiete geben sich die Klinke in die Hand. Wiederholt mit Schauern, Wind und einstelligen Temperaturen. Kurzum: das Erkältungswetter hält Einzug.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fstuermischer-start-in-die-neue-woche-4447137.html\",\"Ein milder und windiger 2. Advent. Auch der Start in die Woche wird stürmisch.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Faktuelle-3-tage-wettervorhersage-4510225.html\",\"Im Video zeigen wir die aktuellsten Wettervorhersagen und Prognosen für die kommenden 3 Tage aus dem ntv Wetter.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fder-regen-und-wolkenfilm-fuer-die-naechsten-48-stunden-4399671.html\",\"Diese Animation zeigt, wie Wolken und Regen heute und morgen über Deutschland ziehen. \",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fstroemungsfilm-der-naechsten-5-tage-4356180.html\",\"Der Strömungsfilm ist unser täglicher Blick auf die Großwetterlage: Die Temperaturentwicklungen für die nächsten Tage sind in der Animation gut zu erkennen.\",1279,719,\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fspektakulaeres-video-aus-antarktis-gigantischer-eisberg-abgebrochen-4713474.html\",\"In der Antarktis ist ein riesiger Eisberg vom Schelfeis abgebrochen. Das teilte die Organisation British Antarctic Survey (BAS) mit. Der Eisberg mit einer Fläche von 1.270 Quadratkilometern – etwa halb so groß wie das Saarland – war Teil des...\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fdas-martinsloch-in-der-schweiz-zweimal-im-jahr-bietet-sich-ein-wunderbares-naturspektakel-4229559.html\",\"Ein fantastisch-schönes Naturspektakel: Zweimal im Jahr scheint die Sonne durch das Felsloch auf die Elmer Kirche. Heute ist es nur online zu sehen - das Wetter ist zu schlecht.\",\"Herbstzeit ist Kürbiszeit! Wir zeigen Ihnen, wie man in nur vier Minuten mit diesem Rezept eine leckere Kürbissuppe kocht.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Ftaifun-rollt-mit-mehr-als-200-km-h-auf-japan-und-suedkorea-zu-hinnamnor-macht-suedostasien-unsicher-5005016.html\",\"Der heftige Taifun HINNAMNOR bedroht Teile Japans und seines Nachbarn Südkorea mit starken Sturmböen und Regenfällen. Die japanische Wetterbehörde rief am Samstag die Inselbewohner der südlichsten Präfektur Okinawa zu Vorsicht auf.\",\"Auf den ersten Blick sieht das Bild wie ein Blätterhaufen aus. Doch ein verborgenes Tier gibt es darin zu entdecken. Was erkennen Sie?\",1832782,2363,1329,\"© Reddit\",\"Am 1. September ist Schluss mit dem Tankrabatt und an der Zapfsäule wird es wieder teurer. Mit unseren Tipps können Sie beim nächsten Tanken dennoch sparen.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Funwetter-in-deutschland-wochenende-eroeffnet-schwuele-gewitter-serie-mit-starkregen-hagel-sturmboeen-5004822.html\",\"Am Samstag zieht ein dickes Regenband über den Westen und Südwesten. Es kann dabei zu lokalen Überflutungen kommen. Wir sagen Ihnen, wann und wo Sie besonders aufpassen müssen.\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Funwetter-und-hitze-in-europa-schwere-gewitter-starkregen-grosser-hagel-sturm-im-unwetter-herbst-5004842.html\",\"Das Mittelmeer ist weiterhin sehr warm. Das heißt \\\"Freie Bahn\\\" für heftige Unwetter. Spanien, Südfrankreich, die Balearen, Korsika, aber auch Norditalien und Griechenland geraten in den Fokus schlimmer Unwetter. Es bestehen derzeit Warnungen.\",1199,674,\"© wetter.de\",\"https:\\u002F\\u002Fwww.wetter.de\\u002Fcms\\u002Fherbst-und-winter-bringen-sich-in-stellung-sturmtiefs-aktiv-mit-auswirkungen-auf-wetter-in-deutschland-5004833.html\",\"Es könnten schon bald sehr turbulente Zeiten werden. Denn mit dem Ende des Sommers leben nun die Stürme über Westeuropa auf - mit Auswirkungen auch auf unser Wetter. \"));</script><script src=\"/_nuxt/84fac38.js\" defer=\"\"></script><script src=\"/_nuxt/39d33ff.js\" defer=\"\"></script><script src=\"/_nuxt/0484b9e.js\" defer=\"\"></script><script src=\"/_nuxt/09f89b3.js\" defer=\"\"></script><script src=\"/_nuxt/40a13c5.js\" defer=\"\"></script><script src=\"/_nuxt/f04ef5e.js\" defer=\"\"></script><script src=\"/_nuxt/c4d09ee.js\" defer=\"\"></script><script src=\"/_nuxt/b573a11.js\" defer=\"\"></script><script src=\"/_nuxt/3e54719.js\" defer=\"\"></script><script src=\"/_nuxt/85ce5ab.js\" defer=\"\"></script><script src=\"/_nuxt/eed9c8a.js\" defer=\"\"></script><script src=\"/_nuxt/b038bfc.js\" defer=\"\"></script><script src=\"/_nuxt/7953f09.js\" defer=\"\"></script>\r\n  \r\n\r\n<script type=\"text/javascript\" id=\"\">__tcfapi(\"addEventListener\",2,function(a,c){if(a&&\"useractioncomplete\"===a.eventStatus){if(window.__TRIGGER_RELOAD__)return;missedPageview=window.dataLayer.find(function(b){return\"Pageview\"===b.event});missedPageview.isCatchUp=!0;window.dataLayer.push(missedPageview);window.dataLayer.push({isCatchUp:!1})}c&&\"tcloaded\"===a.eventStatus&&(console.log(\"___tcloaded___\"),window.dataLayer.push({event:\"tcloaded\"}),__tcfapi(\"removeEventListener\",2,function(b){b&&console.log(\"removed: \"+a.listenerId)},a.listenerId))});</script><script type=\"text/javascript\" id=\"\">\"sp_consent_ga\"==google_tag_manager[\"GTM-KVJBNRQ\"]